@font-face {
    font-family: 'Franklin-Gothic-Condensed';
    src: local('Franklin Gothic Extra Condensed'),local('Franklin Gothic Extra Condensed'),/*savepage-url=../franklin-gothic-condensed.html*/url() format('truetype');
